const LoginPage = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        minHeight: "100vh",
      }}
    >
      <Container style={{ flex: 1, overflowY: "auto" }}>
        <LoginForm />
      </Container>
      <Footer />
    </div>
  );
};

export default LoginPage;
